((global) => {
    function toClipboard(text) {
        if (!text) throw new Error("No text to copy");
        if (text.endsWith("#")) text = text.slice(0, -1);
        navigator.clipboard.writeText(text);
        window.NotificationHandler.show({
            content: "Đã sao chép vào bộ nhớ tạm",
            type: "success"
        });
    }
    /** Injects custom CSS into the document
     * @param {string} css 
     */
    function InjectCSS(css) {
        const sheet = new CSSStyleSheet();
        sheet.replaceSync(css);
        document.adoptedStyleSheets = [...document.adoptedStyleSheets, sheet];
    }

    function AnimateBackground({ light = "linear-gradient(62deg, #8EC5FC 0%, #E0C3FC 100%)", dark = "linear-gradient(225deg, #FF3CAC 0%, #784BA0 50%, #2B86C5 100%)", duration = "15s" } = {}) {
        InjectCSS(`:root, [data-bs-theme="light"] { --bg: ${light} }
        [data-bs-theme=dark] { --bg: ${dark} }
        body { background: var(--bg); background-size: 400% 400%; animation: bg_gradient_animate ${duration} ease infinite; height: 100vh }
    
        @keyframes bg_gradient_animate {
            0% { background-position: 0% 50% }
            50% { background-position: 100% 50% }
            100% { background-position: 0% 50% }
        }`);
    }
    
    /** Debounce function
     * @param {function} func
     * @param {number} wait
     * @returns {function}
     */
    function debounce(callback, wait) {
        let timeoutId = null;
        return (...args) => {
            clearTimeout(timeoutId);
            timeoutId = setTimeout(() => {
                callback(...args);
            }, wait);
        };
    };

    Object.assign(global, { toClipboard, InjectCSS, AnimateBackground, debounce });

})(window);
(() => {
  const html_tree = document.querySelector("html");
  try {
    let theme = localStorage.getItem("theme") || "light";
    if (theme === "auto") theme = window.matchMedia && window.matchMedia("(prefers-color-scheme: dark)").matches ? "dark" : "light";

    html_tree.setAttribute("data-bs-theme", theme);
    localStorage.setItem("theme", theme);
    logger.info('Theme initialized', theme);
  } catch (err) {
    html_tree.setAttribute("data-bs-theme", "light");
    localStorage.setItem("theme", "light");
    logger.error("Failed to initialize theme", err);
  }
})();

((global) => {
    global.bt_dateformatter = function (value, row, index) {
        try {
            let formattedValue = moment(value);
            if (formattedValue._d == "Invalid Date") formattedValue = moment(Number(value));
            if (formattedValue._d == "Invalid Date") return value;
            return `<span data-bs-toggle="tooltip" data-bs-title="${formattedValue.format("DD MMM YYYY, hh:mm")}">${formattedValue.fromNow()}</span>`;
        } catch (e) {
            logger.error("Date Formatter Error: ", e);
            return value;
        }
    };

    global.bt_indexN = function (cell, row, enumObject, index) {
        const count = enumObject + 1;
        return (`<div>${count}</div>`);
    };

    global.formatTextBreakUrl = function (value, row, index) {
        return `<a class="text-break" href='${value}'>${value}</a>`;
    };
})(window);
